/**
 * Definition for singly-linked list.
 * struct ListNode {
 *     int val;
 *     ListNode *next;
 *     ListNode() : val(0), next(nullptr) {}
 *     ListNode(int x) : val(x), next(nullptr) {}
 *     ListNode(int x, ListNode *next) : val(x), next(next) {}
 * };
 */

#include <vector>
#include <iostream>

struct ListNode {
        int val;
        ListNode *next;
        ListNode() : val(0), next(nullptr) {}
        ListNode(int x) : val(x), next(nullptr) {}
        ListNode(int x, ListNode *next) : val(x), next(next) {}
};

void gc(ListNode *list)
{
        ListNode *tmp = nullptr;
        while(list != nullptr)
        {
                tmp = list;
                list = list->next;
                delete tmp;
                tmp = nullptr;
        }
}

ListNode *push_back(ListNode *lastNode, int val)
{
        ListNode *newNode = new ListNode(val);
        lastNode->next = newNode;
        return lastNode->next;
}

ListNode *merge(ListNode *list1, ListNode *list2)
{       
        if(list1 == nullptr)
                return list2;
        if(list2 == nullptr)
                return list1;

        ListNode *head = nullptr, *lastNode = nullptr;

        ListNode **indirect1 = &list1;
        ListNode **indirect2 = &list2;       

        if((*indirect1)->val < (*indirect2)->val)
        {
                head = new ListNode((*indirect1)->val);
                lastNode = head;
                indirect1 = &(*indirect1)->next;
        }
        else
        {
                head = new ListNode((*indirect2)->val);
                lastNode = head;
                indirect2 = &(*indirect2)->next;
        }

        while((*indirect1) != nullptr && (*indirect2) != nullptr)
        {
                if((*indirect1)->val < (*indirect2)->val)
                {
                        lastNode = push_back(lastNode, (*indirect1)->val);
                        indirect1 = &(*indirect1)->next;
                }
                else
                {
                        lastNode = push_back(lastNode, (*indirect2)->val);
                        indirect2 = &(*indirect2)->next;
                }
        }

        while((*indirect1) != nullptr)
        {
                lastNode = push_back(lastNode, (*indirect1)->val);
                indirect1 = &(*indirect1)->next;
        }

        while((*indirect2) != nullptr)
        {
                lastNode = push_back(lastNode, (*indirect2)->val);
                indirect2 = &(*indirect2)->next;
        }

	gc(list1);
	gc(list2);

        return head;
}

ListNode* mergeKLists(std::vector<ListNode*>& lists) 
{
        ListNode *merged = nullptr;

        for(ListNode *ref : lists)
        {
                merged = merge(merged, ref);
        }

        return merged;
}

